33.body:
By default, Eureka will run all transactions with a gas price of 1 Gwei. This might be useful to increase if you'd like to speed up the deployment process, either for convenience, or to resolve an error. We can accomplish this in a dirty way by directly modifying Eureka. Open the file located at ./node_modules/@compound-finance/eureka/src/ethereum.mjs for editing, and within lines 207-218, look at the function there: export async function dispatch({ eth, provider, from, gas, gasPrice }, contract, data) { return await eth.sendTransaction({ from, to: contract, value: 0, gas, gasPrice, data: data }).on('transactionHash', (hash) => { console.log(`Running Ethereum Trx: ${hash}`); });
} We want to hardcode the gasPrice variable. For example, if we were to hardcode it to 7 Gwei, we might modify the gasPrice line (line 213) like so: export async function dispatch({ eth, provider, from, gas, gasPrice }, contract, data) { return await eth.sendTransaction({ from, to: contract, value: 0, gas, gasPrice: '7000000000', // Hardcoding to 7 Gwei data: data }).on('transactionHash', (hash) => { console.log(`Running Ethereum Trx: ${hash}`); });
} Save the file, and all Eureka transactions should now execute with the new gas price value!
